  `link_parameter` varchar(200) DEFAULT NULL COMMENT '链接参数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='后台 - 频道管理表';

