/*Table structure for table `busi_coupon` */

CREATE TABLE `busi_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `coupon_name` varchar(100) DEFAULT NULL COMMENT '优惠券名称',
  `coupon_amount` decimal(10,2) DEFAULT NULL COMMENT '优惠券金额',
  `is_deadlines` smallint(4) DEFAULT '0' COMMENT '是否有期限 0=无期限 1=有期限 默认无期限',
  `term_of_validity` int(11) DEFAULT NULL COMMENT '优惠券期限',
  `coupon_cate` smallint(4) DEFAULT '0' COMMENT '优惠券分类 0=无门槛全品类 1=无门槛单项类 2=满减全品类 3=满减单项类 默认无门槛全品类',
  `satisfy_amount` decimal(10,2) DEFAULT NULL COMMENT '满多少金额才可以使用',
  `prod_cate_id` int(11) DEFAULT NULL COMMENT '商品分类ID',
  `create_user` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  PRIMARY KEY (`id`),
  KEY `prod_cate_id` (`prod_cate_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠券详情';

