/*Table structure for table `busi_customer` */

CREATE TABLE `busi_customer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `account` varchar(30) DEFAULT NULL COMMENT '账号',
  `nick_name` varchar(30) DEFAULT NULL COMMENT '昵称',
  `sex` smallint(6) DEFAULT NULL COMMENT '0 女 1男',
  `email` varchar(40) DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `photo_url` varchar(200) DEFAULT NULL COMMENT '头像',
  `account_status` smallint(6) DEFAULT '0' COMMENT '账号状态 0 未冻结 1已冻结 ',
  `id_card` varchar(30) DEFAULT NULL COMMENT '身份证号',
  `login_password` varchar(50) DEFAULT NULL COMMENT '登录密码   ',
  `pay_password` varchar(50) DEFAULT NULL COMMENT '支付密码  ',
  `cancel_status` smallint(6) DEFAULT '0' COMMENT '注销状态 0 未注销 1 已注销',
  `qrcode_secret` varchar(200) DEFAULT NULL COMMENT '推荐二维码密钥',
  `person_qrcode` varchar(200) DEFAULT NULL COMMENT '个人二维码图片地址',
  `del_flag` smallint(6) DEFAULT '0',
  `real_name` varchar(30) DEFAULT NULL COMMENT '真实姓名',
  `is_member` smallint(6) DEFAULT '1' COMMENT '是否会员 0 是 1 不是 ',
  `game_id` int(11) DEFAULT NULL COMMENT '已关联游戏用户的游戏账号Id',
  `is_partner` smallint(6) DEFAULT '1' COMMENT '是否合作商 0是  1不是',
  `proportion` decimal(10,2) DEFAULT '0.00' COMMENT '合伙人比例',
  `recommend_code` varchar(100) DEFAULT '0' COMMENT '会员推荐码',
  `recommend_reward` smallint(6) DEFAULT '0' COMMENT '推荐奖励是否赠送 0 为赠送 1已赠送',
  PRIMARY KEY (`id`),
  UNIQUE KEY `customer_phone` (`phone`) USING BTREE,
  UNIQUE KEY `uk_game_id` (`game_id`)
) ENGINE=InnoDB AUTO_INCREMENT=100128 DEFAULT CHARSET=utf8 COMMENT='商城用户表';

