/*Table structure for table `busi_customer_bankroll` */

CREATE TABLE `busi_customer_bankroll` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `integral` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '积分',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '奖励金',
  `expense_subsidy` decimal(10,2) DEFAULT '0.00' COMMENT '消费券总补贴',
  `yoka_amount` decimal(10,2) DEFAULT '0.00' COMMENT '已领消费券',
  `not_yoka_amount` decimal(10,2) DEFAULT '0.00' COMMENT '未领消费券',
  `star_coin` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '可用消费券(友旗币)',
