  `reward_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'U币账户(根据U币流水表累加)',
  `game_id` int(11) DEFAULT NULL COMMENT '游戏用户id 用于游戏用户未在商城注册时 记录的U币信息',
  `used_reward_amount` decimal(10,2) DEFAULT '0.00' COMMENT '累计 U币 消费金额',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_bankroll_game_id` (`game_id`),
  KEY `bankroll_customer` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='会员/消费者 账户 ';

