/*Table structure for table `busi_customer_bankroll_flow` */

CREATE TABLE `busi_customer_bankroll_flow` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `flow_category` smallint(6) DEFAULT NULL COMMENT '1 余额 2 积分 3消费券 4微信 5支付宝 6游戏币',
  `flow_type` smallint(6) DEFAULT NULL COMMENT '0 收入 1 支出',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `flow_number` varchar(50) DEFAULT NULL COMMENT '流水号',
  `flow_description` smallint(6) DEFAULT NULL COMMENT '流水类别描述(1提现 2 推荐奖励 3余额支付 4获取星币 5消费券支付 6赠送积分 7摘星消耗积分 8订单消费券退回 9订单余额退回 10微信支付 11支付宝支付 12微信退回 13支付宝退回 14游戏商品反消费券 15推荐消费者消费奖励到余额 16提现退回 17游戏订单合伙人返余额 18游戏订单会员返余额 19 游戏任务奖励游戏币 20订单支付游戏币 21订单退回游戏币 22推荐会员反余额)',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 未删除',
  `bankroll_id` int(11) DEFAULT NULL COMMENT '所属账户id',
  `relation_id` int(11) DEFAULT NULL COMMENT '根据流水类型 关联数据Id',
  `update_time` datetime DEFAULT NULL COMMENT '游戏用户绑定已有帐号 修改流水的操作时间',
  PRIMARY KEY (`id`),
  KEY `bankroll_id` (`bankroll_id`)
) ENGINE=InnoDB AUTO_INCREMENT=186 DEFAULT CHARSET=utf8 COMMENT='会员/消费者 账户流水 ';

