/*Table structure for table `busi_customer_collector` */

CREATE TABLE `busi_customer_collector` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `c_type` smallint(6) NOT NULL COMMENT '0 商品收藏 1店铺收藏',
  `relation_id` int(11) DEFAULT NULL COMMENT '关联数据id',
  `del_flag` smallint(6) DEFAULT '0',
  `customer_id` int(11) NOT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `relation_id_his` int(11) DEFAULT NULL COMMENT '记录删除的收藏id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_union_id` (`relation_id`,`customer_id`,`c_type`),
  KEY `collector_customer` (`customer_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='用户收藏记录';

/*Data for the table `busi_customer_collector` */

