/*Table structure for table `busi_customer_coupon` */

CREATE TABLE `busi_customer_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_id` int(11) DEFAULT NULL COMMENT '用户id',
  `coupon_id` int(11) DEFAULT NULL COMMENT '优惠券id',
  `receive_time` datetime DEFAULT NULL COMMENT '领取优惠券时间',
  `expiry_time` datetime DEFAULT NULL COMMENT '优惠券到期时间',
  `coupon_state` smallint(6) DEFAULT '0' COMMENT '优惠券状态 0=正常 1=已使用 2=已过期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_customer_coupon` */

/*Table structure for table `busi_customer_drawqueue` */

CREATE TABLE `busi_customer_drawqueue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `draw_id` int(11) NOT NULL COMMENT '提现记录id',
  `draw_number` varchar(50) DEFAULT NULL COMMENT '提现流水号',
  `id_type` smallint(6) DEFAULT NULL COMMENT '1 h5  2 app',
  `retry_count` smallint(6) DEFAULT '0' COMMENT '重试次数 3次以上 不处理',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_handle` smallint(6) DEFAULT '0' COMMENT '0 未处理 1 已处理',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `error_desc` varchar(100) DEFAULT NULL COMMENT '异常信息',
  `error_code` varchar(100) DEFAULT NULL COMMENT '异常信息code',
  `status` smallint(6) DEFAULT '0' COMMENT '0 正常  1 异常',
  `handle_time` datetime DEFAULT NULL COMMENT '队列处理时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信提现待处理队列';

/*Data for the table `busi_customer_drawqueue` */

/*Table structure for table `busi_customer_drawrecord` */

CREATE TABLE `busi_customer_drawrecord` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `draw_type` smallint(6) DEFAULT NULL COMMENT '提现类型 1 货款提现 ',
  `draw_amount` decimal(10,2) DEFAULT NULL COMMENT '提现金额  ',
  `bank_number` varchar(50) DEFAULT NULL COMMENT '提现收款账号  bank_card',
  `apply_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '提现申请时间  apply_time',
  `audit_status` smallint(6) DEFAULT '2' COMMENT '0 审核通过 1 审核不通过  2待审核',
  `audit_user` int(11) DEFAULT NULL COMMENT '审核人',
  `audit_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '审核时间  audit_time',
  `receive_user` varchar(30) DEFAULT NULL COMMENT '收款人  receive_user',
  `bankroll_id` int(11) DEFAULT NULL COMMENT '所属账户',
  `del_flag` smallint(6) DEFAULT '0',
  `draw_number` varchar(50) DEFAULT NULL COMMENT '提现流水号',
  `reason` varchar(200) DEFAULT NULL COMMENT '审核不通过原因 不通过状态必填',
  `pay_type` smallint(6) DEFAULT NULL COMMENT '提现方式 0微信支付  1 银行卡',
  `service_charge` decimal(10,2) DEFAULT '0.00' COMMENT '提现手续费',
  `final_amount` decimal(10,2) NOT NULL COMMENT '实际支付金额',
  `id_type` smallint(6) DEFAULT NULL COMMENT '1 h5  2 app',
  `payment_no` varchar(100) DEFAULT NULL COMMENT '企业付款成功，返回的微信订单号',
  `payment_time` varchar(100) DEFAULT NULL COMMENT '企业付款成功时间',
  `err_code` varchar(100) DEFAULT NULL COMMENT '微信返回err_code',
  `err_code_des` varchar(100) DEFAULT NULL COMMENT '微信返回错误代码描述',
  `open_id` varchar(100) DEFAULT NULL COMMENT '企业付款所使用的openId',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户提现记录 ';

/*Data for the table `busi_customer_drawrecord` */

/*Table structure for table `busi_customer_feedback` */

CREATE TABLE `busi_customer_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `c_type` smallint(6) NOT NULL COMMENT '0 功能异常 1体验问题 2新功能建议 3其它',
  `remark` varchar(300) DEFAULT NULL COMMENT '反馈备注',
  `del_flag` smallint(6) DEFAULT '0',
  `customer_id` int(11) NOT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `f_status` smallint(6) DEFAULT '0' COMMENT '反馈处理状态 \r\n            0 未处理  1已处理  ',
  `f_description` varchar(300) DEFAULT NULL,
  `f_email` varchar(50) DEFAULT NULL COMMENT '反馈用户预留 邮箱',
  PRIMARY KEY (`id`),
  KEY `feedback_customer` (`customer_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户反馈';

/*Data for the table `busi_customer_feedback` */

/*Table structure for table `busi_customer_feedbackimg` */

CREATE TABLE `busi_customer_feedbackimg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `del_flag` smallint(6) DEFAULT '0',
  `feedback_id` int(11) NOT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `img_url` varchar(200) DEFAULT NULL,
  `sort_no` smallint(6) DEFAULT '0' COMMENT '排序号',
  PRIMARY KEY (`id`),
  KEY `feedbackImg_feedback` (`feedback_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户反馈关联图片';

/*Data for the table `busi_customer_feedbackimg` */

/*Table structure for table `busi_customer_loginlog` */

CREATE TABLE `busi_customer_loginlog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT '会员/消费者id  或者 店铺 id',
  `operate_type` int(11) DEFAULT NULL COMMENT '操作类型 0 登陆 1 退出',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '事件发生时间',
  `client_type` smallint(6) DEFAULT NULL COMMENT '1 pc 2 wap 3微信 4 app',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `session` varchar(30) DEFAULT NULL COMMENT 'session id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='登陆日志';

/*Data for the table `busi_customer_loginlog` */

/*Table structure for table `busi_customer_receiveaddress` */

CREATE TABLE `busi_customer_receiveaddress` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `phone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `city` varchar(10) DEFAULT NULL COMMENT '城市',
  `area_county` varchar(50) DEFAULT NULL COMMENT '乡镇',
  `address` varchar(200) DEFAULT NULL COMMENT '详细地址',
  `post_code` varchar(10) DEFAULT NULL COMMENT '邮政编码',
  `customer_id` int(11) DEFAULT NULL COMMENT '消费者id  customer_id',
