/*Table structure for table `busi_customer_wechat` */

CREATE TABLE `busi_customer_wechat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_id` int(11) DEFAULT NULL COMMENT '用户',
  `open_id` varchar(50) DEFAULT NULL COMMENT '微信openId',
  `del_flag` smallint(6) NOT NULL DEFAULT '0' COMMENT '0 正常 1 已删除',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `customer_code` varchar(50) NOT NULL COMMENT '用户code 为uuid 唯一 防止open_id 暴漏在客户端',
