/*Table structure for table `busi_mall_activity` */

CREATE TABLE `busi_mall_activity` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `activityName` varchar(50) DEFAULT NULL COMMENT '活动名称',
  `activityImage` varchar(300) DEFAULT NULL COMMENT '活动图片',
  `activityLink` varchar(100) DEFAULT NULL COMMENT '活动链接',
  `activityStatus` int(2) DEFAULT '0' COMMENT '0 正在进行 ,1 已结束，2重新开始',
  `activityBeginDate` datetime DEFAULT NULL COMMENT '活动开始时间',
  `activityendDate` datetime DEFAULT NULL COMMENT '活动结束时间',
  `type` int(2) DEFAULT NULL COMMENT '类型(1.pc端,2.手机端)',
  `activityPriority` int(10) DEFAULT NULL COMMENT '活动排序',
  `create_user` int(11) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_user` int(11) DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商城活动';

/*Data for the table `busi_mall_activity` */

