  `discount` decimal(10,2) DEFAULT NULL COMMENT '折扣',
  `total_amount` decimal(10,2) DEFAULT NULL COMMENT '总价',
  `pay_integral` decimal(10,2) DEFAULT NULL COMMENT '抵扣积分',
  `integral_amount` decimal(10,2) DEFAULT NULL COMMENT '消费券抵扣金额',
