  `pay_type` smallint(6) DEFAULT NULL COMMENT '1 支付宝 2 微信 3纯星币 4余额 5 快捷  ',
  `give_integral` decimal(10,2) DEFAULT NULL COMMENT '赠送的消费券',
  `order_status` smallint(6) DEFAULT '1' COMMENT '0 已取消 1 未付款 2 已付款 3已发货  4已签收 5已评价  6已追评 7退款中 8交易关闭 ',
  `order_sourse` smallint(6) DEFAULT NULL COMMENT '1 PC 2WAP 3 APP  4 微信',
  `receiver` varchar(30) DEFAULT NULL COMMENT '收货人',
  `receive_address_id` int(11) DEFAULT NULL COMMENT '收货地址ID',
  `address` varchar(100) DEFAULT NULL COMMENT '收货地址',
  `phone` varchar(14) DEFAULT NULL COMMENT '联系电话',
  `address_default` smallint(6) DEFAULT NULL COMMENT '是否为默认收货地址（0默认，1不默认）',
  `audit_status` smallint(6) DEFAULT '2' COMMENT '0 审核通过 1 审核不通过  2待审核',
  `total_order_no` varchar(100) DEFAULT NULL COMMENT '总订单号',
  `shop_id` int(11) DEFAULT NULL COMMENT '所属店铺',
  `customer_id` int(11) DEFAULT NULL COMMENT '所属用户',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `orders_no` varchar(100) DEFAULT NULL COMMENT '订单号',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `pay_time` timestamp NULL DEFAULT NULL COMMENT '订单付款时间',
  `delivery_time` timestamp NULL DEFAULT NULL COMMENT '发货时间',
  `complete_time` timestamp NULL DEFAULT NULL COMMENT '订单收货时间',
  `evaluate_time` timestamp NULL DEFAULT NULL COMMENT '评论时间',
  `cancel_time` timestamp NULL DEFAULT NULL COMMENT '取消时间',
  `is_auto_cancel` smallint(6) DEFAULT NULL COMMENT '是否自动取消(0不是 1是)',
  `is_give_integral` smallint(6) DEFAULT '0' COMMENT '订单是否赠送积分(0未赠送，1已赠送)',
  `express_no` varchar(30) DEFAULT NULL COMMENT '快递单号',
  `company_name` varchar(30) DEFAULT NULL COMMENT '快递公司名称',
  `is_rebate` smallint(1) DEFAULT '0' COMMENT '是否送消费券 0.否 1.是',
  `settlement_status` smallint(6) DEFAULT '1' COMMENT '订单结算状态(1未申请 2待审核 3审核通过 4审核拒绝 5已打款）',
  `settlement_amount` decimal(10,2) DEFAULT NULL COMMENT '结算金额',
  `settlement_id` int(11) DEFAULT '0' COMMENT '结算单ID',
  `is_game_order` smallint(6) DEFAULT '0' COMMENT '是否为游戏订单（0普通订单 1游戏订单 2礼包订单 3一元购订单）',
  `game_id` int(11) DEFAULT NULL COMMENT '游戏用户ID',
  `game_notify_result` smallint(6) DEFAULT NULL COMMENT '游戏订单通知状态（0失败 1成功）',
  `tax_type` smallint(6) DEFAULT '0' COMMENT '开发票类型（0没有发票 1个人 2公司）',
  `tax_no` varchar(32) DEFAULT NULL COMMENT '公司开票的税号',
  `tax_company` varchar(32) DEFAULT NULL COMMENT '开票公司',
  `receipt_type` smallint(6) DEFAULT NULL COMMENT '发票类型（1纸质 2电子）',
  `promotion_price` decimal(10,2) DEFAULT NULL COMMENT '推广优惠价',
  `promotion_user` int(11) DEFAULT NULL COMMENT '推荐人ID',
  `reward_amount` decimal(10,2) DEFAULT '0.00' COMMENT '抵扣的游戏币金额',
  `promotion_rebate` smallint(1) DEFAULT '0' COMMENT '推广返利 0.未返 1.已返',
  `partner_id` int(11) DEFAULT NULL COMMENT '合伙人ID',
  `partner_amount` decimal(10,2) DEFAULT NULL COMMENT '返还给合伙人的金额',
  `member_amount` decimal(10,2) DEFAULT NULL COMMENT '返还直接推荐的会员获得金额',
  `upgrade_promotion_user` int(11) DEFAULT NULL COMMENT '推荐人的推荐人ID',
  `upgrade_promotion_price` decimal(10,2) DEFAULT NULL COMMENT '推荐人的推荐人获得的推荐奖励',
  `proxy_shop_id` int(11) DEFAULT NULL COMMENT '代发店铺ID',
  `room_card_num` decimal(10,2) DEFAULT NULL COMMENT '游戏订单房卡数量',
  PRIMARY KEY (`id`),
  KEY `order_customer` (`customer_id`),
  KEY `order_shop` (`shop_id`),
  KEY `order_orderno` (`orders_no`),
  KEY `order_total_order_no` (`total_order_no`),
  KEY `order_status` (`order_status`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='订单 ';

