/*Table structure for table `busi_order_detail` */

CREATE TABLE `busi_order_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_name` varchar(200) DEFAULT NULL COMMENT '商品名称',
  `product_title` varchar(200) DEFAULT NULL COMMENT '商品副标题',
  `original_price` decimal(10,2) DEFAULT NULL COMMENT '商品原价',
  `sell_price` decimal(10,2) DEFAULT NULL COMMENT '商品销售价',
  `number` int(11) DEFAULT NULL COMMENT '数量',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `final_price` decimal(10,2) DEFAULT NULL COMMENT '结算价格',
  `photo_url` varchar(200) DEFAULT NULL COMMENT '商品图片地址',
  `product_spec` varchar(1000) DEFAULT NULL COMMENT '商品规格',
  `order_id` int(11) DEFAULT NULL COMMENT '所属订单',
  `prod_id` int(11) DEFAULT NULL COMMENT '所属商品详情',
  `prod_sku` varchar(30) DEFAULT NULL COMMENT '商品sku',
  `pay_integral` decimal(10,2) DEFAULT NULL COMMENT '使用积分',
  `integral_amount` decimal(10,2) DEFAULT NULL COMMENT '星币抵扣金额',
  `refund_status` smallint(6) DEFAULT '0' COMMENT '是否申请售后（0未申请 1退货中 2退货完成 3退货拒绝 4退货取消）',
  `exchange_id` int(11) DEFAULT NULL COMMENT '售后单ID',
  `product_distinction` smallint(6) DEFAULT NULL COMMENT '商品类型 0.普通商品 1.虚拟商品 3一元商品 4礼包',
  `product_type` smallint(6) DEFAULT NULL COMMENT '商品种类 0.自营商品 1.店铺添加商品 ',
  `promotion_price` decimal(10,2) DEFAULT NULL COMMENT '推广优惠价',
  `upgrade_promotion_price` decimal(10,2) DEFAULT NULL COMMENT '推荐人的推荐人获得该商品的推广赚',
  `is_rebate` int(1) DEFAULT '0' COMMENT '是否返利 0.否 1.是',
  `game_amount` decimal(10,2) DEFAULT NULL COMMENT '商品消费的游戏币数量',
  `room_card_pic` int(11) DEFAULT NULL COMMENT '房卡金额',
  PRIMARY KEY (`id`),
  KEY `order_detail_product_id` (`prod_id`),
  KEY `order_detail_order_id` (`order_id`) USING BTREE,
  KEY `order_detail_product_sku` (`prod_sku`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COMMENT='订单详情  ';

