/*Table structure for table `busi_order_exchange` */

CREATE TABLE `busi_order_exchange` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `exchange_no` varchar(25) DEFAULT NULL COMMENT '售后单号',
  `order_no` varchar(25) DEFAULT NULL COMMENT '订单号',
  `order_detail_id` int(11) DEFAULT NULL COMMENT '订单详情ID',
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `exchange_type` smallint(6) DEFAULT '1' COMMENT '售后类型：1.退货退款 2退款 3.换货',
  `exchange_reason` smallint(6) DEFAULT NULL COMMENT '售后原因（1质量问题 2效果不符 3少件 4商品破损 5假冒品牌 6发票问题 7其他）',
  `exchange_desc` varchar(300) DEFAULT NULL COMMENT '退款说明',
  `exchange_img` varchar(100) DEFAULT NULL COMMENT '退货图片',
  `customer_id` int(11) DEFAULT NULL COMMENT '退货人',
  `exchange_status` smallint(6) DEFAULT '1' COMMENT '退货状态（0取消售后 1.卖家待审核 2.买家待发货 3.卖家待收货 4.卖家待打款 5售后完成）',
  `apply_amount` decimal(20,2) DEFAULT NULL COMMENT '申请退款金额',
  `refund_amount` decimal(20,2) DEFAULT NULL COMMENT '退的余额',
  `refund_star_coin` decimal(20,2) DEFAULT NULL COMMENT '退的星币',
  `refund_total_amount` decimal(20,2) DEFAULT NULL COMMENT '实际退款金额',
  `order_amount` decimal(20,2) DEFAULT NULL COMMENT '订单金额',
  `company_name` varchar(30) DEFAULT NULL COMMENT '快递公司',
  `express_code` varchar(30) DEFAULT NULL COMMENT '快递单号',
  `express_freight` decimal(20,2) DEFAULT NULL COMMENT '快递运费',
  `check_state` smallint(6) DEFAULT '1' COMMENT '审核状态（1待审核 2通过 3拒绝）',
  `money_check` smallint(6) DEFAULT '1' COMMENT '打款审核(1未打款 2同意打款 3拒绝打款 )',
  `refuse_reason` varchar(100) DEFAULT NULL COMMENT '拒绝理由',
  `user_id` int(11) DEFAULT NULL COMMENT '卖家ID',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '退货时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '卖家反馈时间',
  `express_time` timestamp NULL DEFAULT NULL COMMENT '买家发快递时间',
  `collect_time` timestamp NULL DEFAULT NULL COMMENT '卖家收货时间',
  `complete_time` timestamp NULL DEFAULT NULL COMMENT '完成时间（打款时间或者审核拒绝时间）',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '是否删除（0正常 1已删除）',
  `details` varchar(200) DEFAULT NULL COMMENT '详情',
  `proxy_shop_id` int(11) DEFAULT NULL COMMENT '代理店铺ID',
  PRIMARY KEY (`id`),
  KEY `order_exchange_user` (`user_id`) USING BTREE,
  KEY `order_exchange_customer` (`customer_id`),
  KEY `order_exchange_order_detail_id` (`order_detail_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='订单退货';

/*Data for the table `busi_order_exchange` */

