/*Table structure for table `busi_order_settlement` */

CREATE TABLE `busi_order_settlement` (
  `settlement_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '店铺申请结算明细Id',
  `settlement_no` varchar(32) DEFAULT NULL COMMENT '结算单号',
  `shop_id` int(10) DEFAULT NULL COMMENT '店铺Id',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  `customer_id` int(10) DEFAULT NULL,
  `total_cost` decimal(10,2) NOT NULL COMMENT '订单总金额',
  `finalt_total_cost` decimal(10,2) DEFAULT NULL COMMENT '平台应支付结算金额',
  `rake_cost` decimal(10,2) DEFAULT NULL COMMENT '店铺上交平台的佣金',
  `orders_ids` text COMMENT '申请结算的订单id串',
  `reviewer` varchar(50) DEFAULT NULL COMMENT '审核人',
  `reviewer_time` timestamp NULL DEFAULT NULL COMMENT '审核时间',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态 \r\n1.待审核\r\n2.审核通过\r\n3.审核未通过\r\n4.已结算',
  `refuse_reason` varchar(100) DEFAULT NULL COMMENT '拒绝理由',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '申请时间',
  `paymentInfo` varchar(2000) DEFAULT NULL COMMENT '平台给店铺结算后的支付信息,如：对方收款账号，交易号，金额，时间等',
  `payment_time` timestamp NULL DEFAULT NULL,
  `bank_card_name` varchar(20) DEFAULT NULL COMMENT '银行卡名称',
  `bank_card_no` varchar(32) DEFAULT NULL COMMENT '银行卡号',
  `bank_user_name` varchar(10) DEFAULT NULL COMMENT '持卡人姓名',
  `tax_amount` decimal(10,2) DEFAULT '0.00' COMMENT '扣税金额',
  PRIMARY KEY (`settlement_id`),
  UNIQUE KEY `yj_shop_settlement_detail_index_settlementId` (`settlement_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='SHOP_店铺申请结算明细表';

