/*Table structure for table `busi_order_trans_record` */

CREATE TABLE `busi_order_trans_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `totalOrdersNo` varchar(25) DEFAULT NULL COMMENT '总订单号',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '交易金额',
  `deal_no` varchar(200) DEFAULT NULL COMMENT '交易流水号',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `type` smallint(6) DEFAULT NULL COMMENT '1 支付宝 2 微信 5 快捷 ',
  `trans_result` varchar(100) DEFAULT NULL COMMENT '交易结果状态 状态码',
  `return_msg` varchar(300) DEFAULT NULL COMMENT '返回信息',
  `appid` varchar(100) DEFAULT NULL COMMENT '第三方appid',
  `trade_time` timestamp NULL DEFAULT NULL COMMENT '付款时间',
  `exchange_no` varchar(32) DEFAULT NULL COMMENT '退款单号',
  PRIMARY KEY (`id`),
  KEY `order_trans_record_order_no` (`totalOrdersNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='第三方交易记录';

