/*Table structure for table `busi_product` */

CREATE TABLE `busi_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `p_title` varchar(180) DEFAULT NULL COMMENT '商品标题',
  `p_subtitle` varchar(500) DEFAULT NULL COMMENT '商品副标题',
  `prod_name` varchar(100) DEFAULT NULL COMMENT '商品名称',
  `prod_cate_name` varchar(100) DEFAULT NULL COMMENT '商品分类名称',
  `prod_cate_id` int(11) DEFAULT NULL COMMENT '商品分类ID',
  `prod_brand_id` int(11) DEFAULT NULL COMMENT '商品品牌ID',
  `prod_brand_name` varchar(50) DEFAULT NULL COMMENT '品牌名称',
  `prod_code` varchar(50) DEFAULT NULL COMMENT '商品编码',
  `market_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '市场价',
  `vip_price` decimal(10,2) DEFAULT NULL COMMENT '会员价',
  `sell_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '商品销售价(展示)',
  `profits_proportion` decimal(5,2) unsigned DEFAULT NULL COMMENT '商品让利比例',
  `integral_percent` decimal(5,2) unsigned DEFAULT NULL COMMENT '赠送积分比例',
  `prod_unit_id` int(11) DEFAULT NULL COMMENT '商品计量单位ID',
  `prod_unit_name` varchar(10) DEFAULT NULL COMMENT '商品单位',
  `ship_province` smallint(6) DEFAULT NULL COMMENT '发货地省级ID',
  `ship_city` smallint(6) DEFAULT NULL COMMENT '发货地市级ID',
  `ship_address` varchar(50) DEFAULT NULL COMMENT '发货地址',
  `is_freight_free` smallint(4) DEFAULT NULL COMMENT '是否免运费，1=免运费，0=不免，默认1免运费',
  `freight_free_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '满XX免运费',
  `freight` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '运费',
  `is_replacement` smallint(4) DEFAULT NULL COMMENT '是否支持退换货，1=支持，0=不支持，默认1支持',
  `p_storage` int(11) unsigned DEFAULT NULL COMMENT '总库存',
  `audit_state` smallint(4) unsigned DEFAULT '0' COMMENT '审核状态：0=待审核，1=审核中，2=审核未通过，3=审核通过',
  `p_status` smallint(6) DEFAULT NULL COMMENT '0 上架 1 下架 2 售罄 3.待上架',
  `create_user` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `product_img` varchar(200) DEFAULT NULL COMMENT '商品主图',
  `qrcode` varchar(200) DEFAULT NULL COMMENT '商品二维码图片地址',
  `shop_id` int(11) DEFAULT NULL COMMENT '所属店铺',
  `salt` int(11) DEFAULT '0' COMMENT '商品单品变化值，用于该商品生成单品的sku计算',
  `electronic_invoice` smallint(6) DEFAULT '0' COMMENT '电子发票 0.不支持 1.支持',
  `shop_cate_id` int(11) DEFAULT NULL COMMENT '店内分类Id',
  `shop_brand_id` int(11) DEFAULT NULL COMMENT '店内品牌Id',
  `settlement_price` decimal(10,2) DEFAULT NULL COMMENT '结算价格(结算价格与让利比例互斥)',
  `product_type` smallint(6) DEFAULT '0' COMMENT '商品种类 0.自营商品 1.店铺添加商品 默认0',
  `product_distinction` smallint(6) DEFAULT '0' COMMENT '商品类型 0.普通商品 1.虚拟商品 默认为0',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `up_time` datetime DEFAULT NULL COMMENT '商品定时上架时间',
  `down_time` datetime DEFAULT NULL COMMENT '商品定时下架时间',
  `remark` varchar(300) DEFAULT NULL COMMENT '商品详情描述',
  `supply_price` decimal(10,2) DEFAULT '0.00' COMMENT '供货价(商家提供建议价格)',
  `retail_price` decimal(10,2) DEFAULT '0.00' COMMENT '零售价(商家提供建议价格)',
  `share_price` decimal(10,2) DEFAULT '0.00' COMMENT 'U币优惠价',
  `promotion_price` decimal(10,2) DEFAULT '0.00' COMMENT '推广获得优惠',
  `drop_shipping` smallint(1) DEFAULT NULL COMMENT '0.自营发货 1.代发货',
  `drop_shipping_id` int(11) DEFAULT NULL COMMENT '代发货店铺id',
  `flag_price` decimal(10,2) DEFAULT '0.00' COMMENT '友旗币',
  PRIMARY KEY (`id`),
  UNIQUE KEY `prod_code` (`prod_code`),
  KEY `prod_cate_id` (`prod_cate_id`),
  KEY `prod_brand_id` (`prod_brand_id`),
  KEY `prod_shop_id` (`shop_id`)
) ENGINE=InnoDB AUTO_INCREMENT=965 DEFAULT CHARSET=utf8 COMMENT='商品 ';

