/*Table structure for table `busi_product_brand` */

CREATE TABLE `busi_product_brand` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `brand_name` varchar(50) NOT NULL COMMENT '品牌名称',
  `brand_big_img` varchar(200) DEFAULT NULL COMMENT '品牌大图',
  `brand_small_img` varchar(200) DEFAULT NULL COMMENT '品牌小图',
  `title` varchar(50) NOT NULL COMMENT '品牌标题',
  `synopsis` varchar(200) DEFAULT NULL COMMENT '品牌简介',
  `first_word` varchar(4) DEFAULT '0' COMMENT '品牌首字母',
  `sort` int(11) DEFAULT '20' COMMENT '排序编号',
  `is_show` smallint(2) DEFAULT '1' COMMENT '是否有效，1=有效，0=无效',
  `description` text COMMENT '品牌详情',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `brand_type` smallint(6) DEFAULT '0' COMMENT '0 系统品牌  1店铺品牌  店铺品牌无法作为查询条件出现在首页',
  `brand_shop_img` varchar(200) DEFAULT NULL COMMENT '品牌店铺图片',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `brand_name` (`brand_name`)
) ENGINE=InnoDB AUTO_INCREMENT=169 DEFAULT CHARSET=utf8 COMMENT='商品品牌';

