/*Table structure for table `busi_product_cate_brand_rela` */

CREATE TABLE `busi_product_cate_brand_rela` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cate_id` int(11) NOT NULL COMMENT '分类ID',
  `brand_id` int(11) NOT NULL COMMENT '品牌ID',
  `status` smallint(2) DEFAULT '1' COMMENT '是否有效，1=有效，0=无效，默认1有效',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `product_cate_id` (`cate_id`),
  KEY `product_brand_id` (`brand_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='品牌分类关联关系表';

/*Data for the table `busi_product_cate_brand_rela` */

/*Table structure for table `busi_product_cate_param_rela` */

CREATE TABLE `busi_product_cate_param_rela` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cate_id` int(11) NOT NULL COMMENT '分类ID',
  `param_id` int(11) NOT NULL COMMENT '参数ID',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `cate_id` (`cate_id`,`param_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品分类与商品分类参数绑定关系表';

/*Data for the table `busi_product_cate_param_rela` */

/*Table structure for table `busi_product_category` */

CREATE TABLE `busi_product_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cate_name` varchar(30) DEFAULT NULL COMMENT '分类名称',
  `parent_id` int(11) DEFAULT '-1' COMMENT '父节点id   -1 代表 顶层  对应 cate_level  为 1',
  `sort` smallint(6) DEFAULT '10' COMMENT '排序号',
  `is_show` smallint(6) DEFAULT '0' COMMENT ' 0 显示  1 不显示',
  `cate_level` smallint(6) NOT NULL COMMENT '分类层级   1 一级    2  二级    3  三级  ',
  `cate_type` smallint(6) DEFAULT '0' COMMENT '商品分类所属终端：0=通用，1=移动端，2=PC端',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user` int(11) DEFAULT NULL,
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_leaf` smallint(2) DEFAULT '0' COMMENT '是否是子分类，parentId为空或为-1时为0，非空或大于0时为1，默认为0',
  `cate_img` varchar(200) DEFAULT NULL COMMENT '分类图片',
  `cate_mobile_name` varchar(30) DEFAULT NULL COMMENT '移动端使用名称',
  `cate_belong` smallint(6) DEFAULT '0' COMMENT '0 实体商品分类 1 虚拟商品分类',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `shopping_guide` varchar(50) DEFAULT NULL COMMENT '二级分类导购词',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=593 DEFAULT CHARSET=utf8 COMMENT='商品分类';

