/*Table structure for table `busi_product_category_relation` */

CREATE TABLE `busi_product_category_relation` (
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) DEFAULT NULL COMMENT '商品id',
  `category_id` int(11) DEFAULT NULL COMMENT '品牌id',
  PRIMARY KEY (`id`),
  KEY `product_category_category` (`category_id`) USING BTREE,
  KEY `product_category_product` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品和商品分类关系表';

/*Data for the table `busi_product_category_relation` */

/*Table structure for table `busi_product_catespeci_relation` */

CREATE TABLE `busi_product_catespeci_relation` (
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `category_id` int(11) DEFAULT NULL COMMENT '商品分类id',
  `speci_id` int(11) DEFAULT NULL COMMENT '商品规格id',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`),
  KEY `product_catespeci_cate` (`category_id`),
  KEY `product_catespeci_spec` (`speci_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品分类和商品规格关系表';

/*Data for the table `busi_product_catespeci_relation` */

/*Table structure for table `busi_product_detail` */

CREATE TABLE `busi_product_detail` (
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `prod_id` int(11) NOT NULL COMMENT '商品ID',
  `cost_price` decimal(12,2) DEFAULT '0.00' COMMENT '供货价(商家提供建议价格)',
  `sale_price` decimal(12,2) DEFAULT '0.00' COMMENT '销售价',
  `member_price` decimal(12,2) DEFAULT '0.00' COMMENT '零售价(商家提供建议价格)',
  `market_price` decimal(12,2) DEFAULT '0.00' COMMENT '市场价',
  `vip_price` decimal(12,2) DEFAULT '0.00' COMMENT '会员价',
  `prod_param` text COMMENT '商品参数（多余字段，即将被删除）',
  `prod_details` text COMMENT '商品图文详情(多余字段，即将被删除)',
  `prod_speci` varchar(200) DEFAULT NULL COMMENT '商品规格json',
  `sku_code` varchar(50) NOT NULL COMMENT '商品SKU编码',
  `p_storage` smallint(6) DEFAULT NULL COMMENT '商品库存',
  `p_status` smallint(6) DEFAULT '0' COMMENT '0 上架  1 下架 2 售罄',
  `create_user` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `u_price` decimal(10,2) DEFAULT '0.00' COMMENT 'U币',
  `promotion_price` decimal(10,2) DEFAULT '0.00' COMMENT '推广赚',
  `flag_price` decimal(10,2) DEFAULT '0.00' COMMENT '友旗币',
  `number` int(10) DEFAULT '0' COMMENT '数量',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sku_code` (`sku_code`),
  KEY `product_detail_product` (`prod_id`)
