/*Table structure for table `busi_product_detanorm_relation` */

CREATE TABLE `busi_product_detanorm_relation` (
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `prod_detail_id` int(11) DEFAULT NULL COMMENT '商品详情id',
  `norms_id` int(11) DEFAULT NULL COMMENT '商品规格id',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`),
  KEY `product_detanorm_product` (`prod_detail_id`),
  KEY `product_detanorm_norm` (`norms_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品详情和商品规格关系表';

/*Data for the table `busi_product_detanorm_relation` */

/*Table structure for table `busi_product_evaluate` */

CREATE TABLE `busi_product_evaluate` (
  `evaluate_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品评价ID',
  `order_id` int(11) DEFAULT NULL COMMENT '订单ID',
  `order_no` varchar(32) DEFAULT NULL COMMENT '订单号',
  `product_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `product_suk` varchar(20) DEFAULT NULL COMMENT '商品SUK',
  `product_name` varchar(300) DEFAULT NULL COMMENT '商品名称',
  `product_title` varchar(300) DEFAULT NULL COMMENT '商品标题',
  `product_spec` varchar(1000) DEFAULT NULL COMMENT '商品规格',
  `product_img` varchar(100) DEFAULT NULL COMMENT '商品主图',
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `content` varchar(1000) DEFAULT NULL COMMENT '评价内容',
  `evaluate_img` varchar(1000) DEFAULT NULL COMMENT '评价的图片集',
  `product_star` smallint(6) DEFAULT NULL COMMENT '商品评价星星的数量',
  `service_star` smallint(6) DEFAULT NULL COMMENT '服务评价星星数量',
  `logistics_star` smallint(6) DEFAULT NULL COMMENT '物流评价星星数量',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '评论时间',
  `evaluate_user` int(11) DEFAULT NULL COMMENT '评论人',
  `add_evaluate` tinyint(2) DEFAULT '0' COMMENT '是否为追评（0不是，1是）',
  `answer` varchar(1000) DEFAULT NULL COMMENT '店家回复',
  `answer_time` timestamp NULL DEFAULT NULL COMMENT '店家回复时间',
  `is_show` smallint(6) DEFAULT '1' COMMENT '是否显示（0隐藏，1显示）',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  PRIMARY KEY (`evaluate_id`),
  KEY `product_evaluate_order` (`order_id`),
  KEY `product_evaluate_product` (`product_id`),
  KEY `product_evaluate_customer` (`evaluate_user`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

