/*Table structure for table `busi_product_guess` */

CREATE TABLE `busi_product_guess` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `prod_id` int(10) DEFAULT NULL COMMENT '关联商品id',
  `sort` smallint(6) DEFAULT NULL COMMENT '排序号',
  `create_user` smallint(10) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_user` smallint(10) DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  PRIMARY KEY (`id`),
  KEY `product_guess_product` (`prod_id`)
