/*Table structure for table `busi_product_speci` */

CREATE TABLE `busi_product_speci` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `speci_name` varchar(20) NOT NULL COMMENT '规格名称',
  `status` smallint(2) DEFAULT NULL COMMENT '是否有效，1=有效，0=无效，默认有效',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_product_speci` */

/*Table structure for table `busi_product_speci_val` */

CREATE TABLE `busi_product_speci_val` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `speci_val_name` varchar(20) NOT NULL COMMENT '规格值',
  `status` smallint(2) NOT NULL DEFAULT '1' COMMENT '是否有效，1=有效，0=无效，默认1有效',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_product_speci_val` */

/*Table structure for table `busi_product_speci_val_rela` */

CREATE TABLE `busi_product_speci_val_rela` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `speci_id` int(11) NOT NULL COMMENT '规格关联ID',
  `speci_val_id` int(11) DEFAULT NULL COMMENT '规格值关联ID',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `product_speci_spec` (`speci_id`),
  KEY `product_speci_sepc_val` (`speci_val_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_product_speci_val_rela` */

/*Table structure for table `busi_product_tag` */

CREATE TABLE `busi_product_tag` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tag_name` varchar(50) NOT NULL COMMENT '标签名称',
  `tag_content` varchar(200) DEFAULT NULL COMMENT '标签内容',
  `tag_img` varchar(200) DEFAULT NULL COMMENT '标签图标',
  `is_show` smallint(2) unsigned zerofill DEFAULT '01' COMMENT '是否显示，1=显示，0=不显示，默认1显示',
  `del_flag` smallint(2) DEFAULT '0' COMMENT '是否删除，1=删除，0=未删除',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `tag_name` (`tag_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_product_tag` */

/*Table structure for table `busi_product_tag_rela` */

CREATE TABLE `busi_product_tag_rela` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `prod_id` int(11) NOT NULL COMMENT '商品ID',
  `tag_id` int(11) NOT NULL COMMENT '标签ID',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '是否删除标记：0未删除，1删除',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `prod_id` (`prod_id`,`tag_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_product_tag_rela` */

/*Table structure for table `busi_product_unit` */

CREATE TABLE `busi_product_unit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `unit_name` varchar(4) NOT NULL COMMENT '单位名称',
  `sort` smallint(2) unsigned zerofill DEFAULT '01' COMMENT '排序编号',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `is_show` smallint(2) unsigned zerofill DEFAULT NULL COMMENT '是否显示，1=显示，0=不显示，默认1显示',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 未删除 1 已删除',
  PRIMARY KEY (`id`)
