/*Table structure for table `busi_shop` */

CREATE TABLE `busi_shop` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_name` varchar(50) DEFAULT NULL COMMENT '店铺名称',
  `shop_qrcode` varchar(200) DEFAULT NULL COMMENT '店铺二维码',
  `shop_wap_photo` varchar(200) DEFAULT NULL COMMENT '店铺wap 图片',
  `shop_main_photo` varchar(200) DEFAULT NULL COMMENT '店铺主图',
  `shop_decorate` longtext COMMENT '店铺装饰内容',
  `shop_logo` varchar(200) DEFAULT NULL COMMENT '店铺LOGO',
  `shop_memo` varchar(200) DEFAULT NULL COMMENT '店铺简介',
  `shop_description` varchar(1000) DEFAULT NULL COMMENT '店铺描述',
  `audit_status` smallint(6) DEFAULT '2' COMMENT '0 审核通过 1 审核不通过  2待审核',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `line_pay_qrcode` varchar(200) DEFAULT NULL COMMENT '线下店铺支付二维码',
  `postage` decimal(10,2) DEFAULT NULL COMMENT '邮费',
  `postage_free` decimal(10,2) DEFAULT NULL COMMENT '订单满xx 包邮额度',
  `company_audit` smallint(6) DEFAULT NULL COMMENT '0 通过  1 未通过 2 待审核',
  `account` varchar(30) DEFAULT NULL COMMENT '账号',
  `companyinfo_id` int(11) DEFAULT NULL COMMENT '所属企业id',
  `customer_id` int(11) DEFAULT NULL COMMENT '所属消费者/会员',
  `shop_phone` varchar(20) DEFAULT NULL COMMENT '店铺电话',
  `shop_type` smallint(6) DEFAULT '0' COMMENT '0 实体店铺 1 游戏店铺',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `phone_show` smallint(6) DEFAULT '0' COMMENT '店铺电话是否显示 0 显示 1不显示',
  `visitor_count` int(11) DEFAULT '0' COMMENT '店铺访问次数 浏览首页增加一次',
  `shop_main_product` varchar(200) DEFAULT NULL COMMENT '主营商品',
  PRIMARY KEY (`id`),
  KEY `shop_customer` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='店铺 ';

