/*Table structure for table `busi_special_parameters` */

CREATE TABLE `busi_special_parameters` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `para_name` varchar(20) DEFAULT NULL COMMENT '参数名称',
  `para_value` varchar(300) DEFAULT NULL COMMENT '参数值',
  `para_describe` varchar(200) DEFAULT NULL COMMENT '描述',
  `para_type` int(1) DEFAULT '0' COMMENT '类型 0.文本框，1.单选 2.下拉框',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `product_id` int(10) NOT NULL COMMENT '商品Id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_special_parameters` */

/*Table structure for table `busi_sys_actorlog` */

CREATE TABLE `busi_sys_actorlog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `audit_user` int(11) NOT NULL COMMENT '操作人',
  `operate_time` datetime NOT NULL,
  `method_description` varchar(30) NOT NULL COMMENT '操作方法描述 新增+业务名称  修改+业务名称 ',
  `relation_data` varchar(50) NOT NULL COMMENT '一般如数据 id ',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='后台系统操作记录表';

/*Data for the table `busi_sys_actorlog` */

/*Table structure for table `busi_sys_area` */

CREATE TABLE `busi_sys_area` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(10) NOT NULL COMMENT '省市县编码',
  `name` varchar(20) NOT NULL COMMENT '省市区名称',
  `parent_id` varchar(10) DEFAULT NULL COMMENT '上级id',
  `short_name` varchar(20) DEFAULT NULL COMMENT '简称',
  `level_type` smallint(2) unsigned zerofill DEFAULT NULL COMMENT '级别类型',
  `city_code` varchar(10) DEFAULT NULL COMMENT '城市区号',
  `zip_code` varchar(10) DEFAULT NULL COMMENT '邮编',
  `full_name` varchar(50) DEFAULT NULL COMMENT '组合全称',
  `lng` varchar(15) DEFAULT NULL COMMENT '经度',
  `lat` varchar(15) DEFAULT NULL COMMENT '纬度',
  `pinyin` varchar(50) DEFAULT NULL COMMENT '全称拼音',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3753 DEFAULT CHARSET=utf8 COMMENT='地级市邮编级联关系表';

