/*Table structure for table `busi_sys_banner` */

CREATE TABLE `busi_sys_banner` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `link_url` varchar(200) DEFAULT NULL,
  `sort` smallint(6) DEFAULT '0' COMMENT '排序号',
  `is_show` smallint(6) DEFAULT '0' COMMENT ' 0 显示  1 不显示',
  `photo_url` varchar(200) DEFAULT NULL COMMENT '图片地址',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_user` int(11) DEFAULT NULL,
  `update_user` int(11) DEFAULT NULL,
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `theme` varchar(200) DEFAULT NULL COMMENT '主题',
  `memo` varchar(500) DEFAULT NULL COMMENT '简介',
  `banner_type` smallint(6) DEFAULT '0' COMMENT '所属 业务   0 手机端   1 PC端',
  `banner_position` smallint(11) DEFAULT '0' COMMENT 'banner图位置 0 顶部  1其它',
  `link_markup` smallint(6) DEFAULT '0' COMMENT '链接标记 0=商品详情 1=商品三级分类列表 2=搜索页面 3=商品搜索详情页面 4=公告详情 默认0',
  `link_parameter` varchar(200) DEFAULT NULL COMMENT '链接参数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='banner 表';

