/*Table structure for table `busi_sys_floor` */

CREATE TABLE `busi_sys_floor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `floor_name` varchar(30) DEFAULT NULL COMMENT '楼层名称',
  `sort` smallint(6) DEFAULT '0' COMMENT '排序号',
  `create_user` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_show` smallint(6) DEFAULT '0' COMMENT ' 0 显示  1 不显示',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 正常 1 已删除',
  `photo_url` varchar(200) DEFAULT NULL COMMENT '楼层大图',
  `floor_type` smallint(6) DEFAULT '0' COMMENT '楼层所属 0 手机端 1pc端',
  `link_markup` smallint(6) DEFAULT NULL COMMENT '链接标记 0=商品详情 1=商品三级分类列表 2=搜索页面 3=商品搜索详情页面 4=公告详情',
  `link_parameter` varchar(200) DEFAULT NULL COMMENT '链接参数',
  `floor_link` varchar(200) DEFAULT NULL COMMENT '楼层链接',
  `icon` varchar(200) DEFAULT NULL COMMENT '图标',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='楼层表';

