/*Table structure for table `busi_sys_floor_detail` */

CREATE TABLE `busi_sys_floor_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `is_show` smallint(6) DEFAULT '0' COMMENT ' 0 显示  1 不显示',
  `create_user` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `content_id` int(11) DEFAULT NULL COMMENT '内容id',
  `product_link` varchar(200) DEFAULT NULL COMMENT '商品链接',
  `sort` smallint(6) DEFAULT '0' COMMENT '排序号',
  `photo_url` varchar(200) DEFAULT NULL COMMENT '图片地址',
  `photo_type` smallint(6) DEFAULT NULL COMMENT '1 正方形 2 长方形',
  `floor_id` int(11) DEFAULT NULL COMMENT '所属楼层id',
  `del_flag` smallint(6) DEFAULT '0' COMMENT '0 未删除 1 已删除',
  `content_type` smallint(6) DEFAULT '0' COMMENT '元素类型 0 品牌 1商品',
  `description` varchar(200) DEFAULT NULL COMMENT '名称',
  PRIMARY KEY (`id`),
  KEY `sys_floor_detail_floor_id` (`floor_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1003 DEFAULT CHARSET=utf8 COMMENT='楼层商品表';

