/*Table structure for table `busi_sys_function` */

CREATE TABLE `busi_sys_function` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fun_name` varchar(30) DEFAULT NULL,
  `fun_url` varchar(200) DEFAULT NULL,
  `create_user` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `del_flag` smallint(6) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_sys_function` */

/*Table structure for table `busi_sys_help_classify` */

CREATE TABLE `busi_sys_help_classify` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `classify_name` varchar(50) DEFAULT NULL COMMENT '分类名称',
  `classify_img` varchar(100) DEFAULT NULL COMMENT '帮助中心分类的图片',
  `sort` smallint(6) DEFAULT NULL COMMENT '排序',
  `is_show` smallint(6) DEFAULT '1' COMMENT '是否显示（0隐藏，1显示）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_sys_help_classify` */

/*Table structure for table `busi_sys_help_praise` */

CREATE TABLE `busi_sys_help_praise` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '点赞ID',
  `customer_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `question_id` int(11) DEFAULT NULL COMMENT '问答ID',
  `praise_status` smallint(6) DEFAULT NULL COMMENT '点赞状态（1已点赞，2没帮助,3已取消）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_sys_help_praise` */

/*Table structure for table `busi_sys_help_question` */

CREATE TABLE `busi_sys_help_question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question_name` varchar(100) DEFAULT NULL COMMENT '问答标题',
  `question_answer` varchar(300) DEFAULT NULL COMMENT '问题答案',
  `sort` smallint(6) DEFAULT NULL COMMENT '排序',
  `is_show` smallint(6) DEFAULT NULL COMMENT '是否显示（0隐藏，1显示）',
  `classify_id` int(11) DEFAULT NULL COMMENT '分类ID',
  `question_subTitle` varchar(10) DEFAULT NULL COMMENT '帮助副标题',
  PRIMARY KEY (`id`),
  KEY `sys_help_question_classify` (`classify_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='帮助中心';

/*Data for the table `busi_sys_help_question` */

/*Table structure for table `busi_sys_intf_exception` */

CREATE TABLE `busi_sys_intf_exception` (
  `intf_addr` varchar(200) NOT NULL COMMENT '接口地址',
  `req_param` text COMMENT '接口请求参数',
  `head_param` varbinary(200) DEFAULT NULL COMMENT '接口请求头参数',
  `busi_class` varchar(200) DEFAULT NULL COMMENT '业务执行类名',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `busi_sys_intf_exception` */

/*Table structure for table `busi_sys_intf_pattern` */

CREATE TABLE `busi_sys_intf_pattern` (
  `pattern` varchar(50) NOT NULL COMMENT '匹配的接口地址，以/开头，不以/结尾',
  `module` varchar(20) NOT NULL DEFAULT 'SYSTEM' COMMENT '所属模块',
  `permission` varchar(20) NOT NULL DEFAULT 'USER' COMMENT '需要对应权限才能访问，默认登陆用户访问',
  `status` smallint(2) unsigned zerofill DEFAULT '01' COMMENT '有效状态：1=有效，0=无效，默认1有效',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  UNIQUE KEY `pattern` (`pattern`,`permission`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='需要拥有特殊权限才能访问的接口地址配置表';

