/*Table structure for table `busi_sys_task` */

CREATE TABLE `busi_sys_task` (
  `task_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_name` varchar(50) NOT NULL COMMENT '任务名称',
  `task_group` varchar(50) NOT NULL COMMENT '任务组',
  `task_class` varchar(100) NOT NULL COMMENT '任务实现类',
  `task_type` smallint(2) unsigned zerofill DEFAULT NULL COMMENT '任务类型，1=定时任务，2=计划任务，3=触发任务',
  `task_period` int(10) unsigned DEFAULT NULL COMMENT '定时时间，task_type=1时不能为空',
  `task_cron` varchar(20) DEFAULT NULL COMMENT '计划表达式，task_type=2时不能为空',
  `status` smallint(2) unsigned zerofill DEFAULT '00' COMMENT '是否有效，1=有效，0=无效，默认1有效',
  `remarks` varchar(200) DEFAULT NULL COMMENT '备注',
  `is_initial` smallint(2) unsigned zerofill DEFAULT NULL COMMENT '是否系统启动时自动启动',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`task_id`),
  UNIQUE KEY `task_name` (`task_name`,`task_group`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='定时任务定义表';

/*Data for the table `busi_sys_task` */

